import React from 'react';
import Button from '@material-ui/core/Button';
import { Link } from 'react-router-dom';

const Landing = () => {
    return (
        <div>
            <div>
                Landing
            </div>

            <Link to="/nomination">
                <Button>
                    Touch me
                </Button>
            </Link>
        </div>
    );
};

export default Landing;
